import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeNode, setActiveNode] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveNode(prev => (prev + 1) % 8);
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  // Layer configuration with detailed labels
  const layers = [
    { nodes: 4, label: 'Input Layer' },
    { nodes: 6, label: 'Hidden Layer 1' },
    { nodes: 6, label: 'Hidden Layer 2' },
    { nodes: 4, label: 'Output Layer' }
  ];

  return (
    <div style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Neural Network Visualization */}
      <svg
        width="100%"
        height="100%"
        viewBox="0 0 600 600"
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
        }}
      >
        {/* Connection Lines */}
        {Array.from({ length: 20 }).map((_, i) => {
          const startX = Math.random() * 600;
          const startY = Math.random() * 600;
          const endX = Math.random() * 600;
          const endY = Math.random() * 600;

          return (
            <line
              key={`line-${i}`}
              x1={startX}
              y1={startY}
              x2={endX}
              y2={endY}
              stroke="#3B82F6"
              strokeWidth="1"
              strokeOpacity="0.2"
              strokeDasharray="4"
            >
              <animate
                attributeName="strokeOpacity"
                values="0.2;0.4;0.2"
                dur={`${3 + Math.random() * 2}s`}
                repeatCount="indefinite"
              />
            </line>
          );
        })}

        {/* Data Flow Particles */}
        {Array.from({ length: 12 }).map((_, i) => (
          <circle
            key={`particle-${i}`}
            r="3"
            fill="#3B82F6"
          >
            <animateMotion
              path={`M ${Math.random() * 600} ${Math.random() * 600} 
                     q ${-200 + Math.random() * 400} ${-200 + Math.random() * 400} 
                       ${-100 + Math.random() * 200} ${-100 + Math.random() * 200}`}
              dur={`${5 + Math.random() * 5}s`}
              repeatCount="indefinite"
            />
          </circle>
        ))}
      </svg>

      {/* Data Nodes */}
      {Array.from({ length: 8 }).map((_, i) => {
        const angle = (i * 45) * (Math.PI / 180);
        const radius = 200;
        const x = 300 + Math.cos(angle) * radius;
        const y = 300 + Math.sin(angle) * radius;

        return (
          <div
            key={`node-${i}`}
            style={{
              position: 'absolute',
              top: y - 30,
              left: x - 30,
              width: '60px',
              height: '60px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              flexDirection: 'column',
              background: i === activeNode ? 
                'linear-gradient(45deg, rgba(59, 130, 246, 0.2), rgba(37, 99, 235, 0.2))' : 
                'transparent',
              borderRadius: '50%',
              transition: 'all 0.3s ease',
              animation: `pulse ${2 + Math.random()}s infinite ${Math.random()}s`,
            }}
          >
            <div style={{
              fontSize: '24px',
              color: '#3B82F6',
              opacity: i === activeNode ? 1 : 0.6,
            }}>
              {getNodeIcon(i)}
            </div>
            <div style={{
              fontSize: '12px',
              color: '#94A3B8',
              marginTop: '4px',
              opacity: i === activeNode ? 1 : 0.6,
            }}>
              {getNodeLabel(i)}
            </div>
          </div>
        );
      })}

      {/* Central Element */}
      <div style={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '120px',
        height: '120px',
        background: 'linear-gradient(45deg, rgba(59, 130, 246, 0.1), rgba(37, 99, 235, 0.1))',
        borderRadius: '50%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        flexDirection: 'column',
        animation: 'pulse 3s infinite',
      }}>
        <div style={{
          fontSize: '36px',
          color: '#3B82F6',
          marginBottom: '5px',
        }}>
          ML
        </div>
        <div style={{
          fontSize: '14px',
          color: '#94A3B8',
        }}>
          Core
        </div>
      </div>

      {/* Layer Labels */}
      {layers.map((layer, i) => (
        <div
          key={`label-${i}`}
          style={{
            position: 'absolute',
            top: 600 - 40,
            left: 100 * (i + 1) - 45, // Adjusted left position for longer labels
            color: '#94A3B8',
            fontSize: '14px',
            textAlign: 'center',
            fontWeight: '500',
            letterSpacing: '0.5px',
            background: 'rgba(15, 23, 42, 0.3)',
            padding: '4px 8px',
            borderRadius: '4px',
            backdropFilter: 'blur(4px)',
          }}
        >
          {layer.label}
        </div>
      ))}
    </div>
  );
}

function getNodeIcon(index) {
  const icons = ['üìä', 'üîç', 'üìà', 'üßÆ', 'üìâ', 'üîÑ', 'üìã', 'üí°'];
  return icons[index];
}

function getNodeLabel(index) {
  const labels = [
    'Analysis',
    'Research',
    'Growth',
    'Compute',
    'Metrics',
    'Process',
    'Data',
    'Insights'
  ];
  return labels[index];
}

export default AIVisual;
